import * as React from 'react';

// Functions
import HostHomesHeader from '../../components/hosthomes/functions/HostHomesHeader';

const background = require('../../../public/img/high/hosthome.jpg');

export default () => {
  return (
    <div>
      <HostHomesHeader />
      <div className='bg-red-500 w-full max-w-layout mx-auto relative'>
        <div>
          <img
            src={background}
            style={{
              maxHeight: '60rem'
            }}
            className='w-full relative object-cover h-144'
          />
        </div>
        <div
          style={{ right: 50 }}
          className='bg-white absolute top-0 right-0 w-104'>
          <div className='m-4'>
            <div
              style={{ fontFamily: 'airbnb-bold' }}
              className='text-gray-850 text-4xl'>
              Earn money as an Airbnb host
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
